"use strict";

import { ParticleGroup } from "./particleGroup.js";
import { RainGroup } from "./rainGroup.js";

class App {
    constructor(img) {
        this.canvas = document.querySelector("canvas");
        this.ctx = this.canvas.getContext("2d");
        this.stageWidth = document.body.clientWidth;
        this.stageHeight = document.body.clientHeight;
        this.mouse = {
            x: null,
            y: null,
            radius: 50,
        };

        this.particleGroup = new ParticleGroup(
            this.ctx,
            this.stageWidth,
            this.stageHeight,
            img,
            100,
            65
        );

        this.rainGroup = new RainGroup(this.stageWidth, this.stageHeight);

        this.resize();

        window.addEventListener("mousemove", (event) => {
            this.mouse.x = event.x;
            this.mouse.y = event.y;
        });
        window.addEventListener("resize", this.resize.bind(this), false);
        window.requestAnimationFrame(this.animate.bind(this));
    }

    resize() {
        this.stageWidth = document.body.clientWidth;
        this.stageHeight = document.body.clientHeight;

        //레티나 디스플레이를 위해서
        this.canvas.width = this.stageWidth * 2;
        this.canvas.height = this.stageHeight * 2;
        this.ctx.scale(2, 2);

        this.particleGroup.resize(this.stageWidth, this.stageHeight);
        this.rainGroup.resize(this.stageWidth, this.stageHeight);
    }

    animate() {
        this.ctx.fillStyle = "rgba(0,0,0,0.5)";
        this.ctx.fillRect(0, 0, this.stageWidth, this.stageHeight);
        this.ctx.drawImage(
            backgroundImg,
            this.stageWidth / 2 - 400 / 2,
            this.stageHeight / 2 - 260 / 2,
            400,
            260
        );
        this.rainGroup.draw(this.ctx);
        this.particleGroup.draw(this.mouse);

        window.requestAnimationFrame(this.animate.bind(this));
    }
}

const backgroundImg = new Image(400, 260);
backgroundImg.src = "./Img/background2.png";
//const textImg = new Image();
const volumeBtn = document.querySelector(".volumeBtn");
const volumeIcon = volumeBtn.querySelector("i");
const bgm = new Audio("./sound/background.mp3");

async function loadImg() {
    //textImg.src = "./Img/defaultText.png";
    const png = new Image();
    png.src =
        "data:image/png;base64,";
    return png;
}

function bgmInit() {
    bgm.loop = true;
    bgm.volume = 0.2;
    let isMusicOn = false;

    volumeBtn.addEventListener("click", (event) => {
        if (isMusicOn) {
            volumeIcon.classList.remove("fa-volume-up");
            volumeIcon.classList.add("fa-volume-mute");
            //console.log(bgm);
            bgm.pause();
        } else {
            volumeIcon.classList.remove("fa-volume-mute");
            volumeIcon.classList.add("fa-volume-up");
            bgm.play();
        }
        isMusicOn = !isMusicOn;
    });
}

window.onload = (() => {
    console.log("onload");
    loadImg()
        .then((img) => {
            bgmInit();
            const app = new App(img);
        })
        .catch((error) => {
            console.log(error);
        });
    //const app = new App(png);
})();
